import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Route,Routes } from 'react-router-dom';
import ShopCategories from './Pages/ShopCategories';
import LoginSignup from './Pages/LoginSignup';
import Shop from './Pages/Shop';
import Products from './Pages/Products';
import Cart from './Pages/Cart';
import Footer from './Components/Footer/Footer';
import Fatilizer_banner from './Components/Assets/Fatilizer_banner.png'
import women_banner from './Components/Assets/banner_women.png'
import kid_banner from './Components/Assets/banner_kids.png'


function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' exact element={<Shop/>} />
        <Route path='/Fatilizer' exact element={<ShopCategories banner={Fatilizer_banner} category="Fatilizer"/>} />
        <Route path='/Vegetables' exact element={<ShopCategories banner={women_banner} category="Vegetables"/>} />
        <Route path='/Fruits' exact element={<ShopCategories banner={kid_banner} category="Fruits"/>} />
        <Route path='/Products' exact element={<Products/>}>
               <Route path=':productId' element={<Products/>} />
        </Route>
        <Route path='/Cart' exact element={<Cart/>} />
        <Route path='/login' exact element={<LoginSignup/>} />
      </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
